import React from 'react';

const CoinTable = ({ cryptoList }) => {
  return (
    <div className="coin-table-container">
      <table className="coin-table">
        <thead>
          <tr>
            <th>Coin</th>
            <th>Price</th>
            <th>24h</th>
            <th>24h Volume</th>
            <th>Market Cap</th>
          </tr>
        </thead>
        <tbody>
          {cryptoList.map(crypto => (
            <tr key={crypto.id} onClick={() => window.location.href = `/${crypto.id}`}>
              <td>
                <img src={crypto.icon} alt={`${crypto.name} icon`} style={{ width: '20px', marginRight: '10px' }} />
                {crypto.name}
              </td>
              <td>${parseFloat(crypto.priceUsd).toFixed(2)}</td>
              <td className={crypto.changePercent24Hr > 0 ? 'positive-change' : 'negative-change'}>
                {crypto.changePercent24Hr ? `${crypto.changePercent24Hr.toFixed(2)}%` : 'N/A'}
              </td>
              <td>${parseFloat(crypto.volumeUsd24Hr).toFixed(2)}</td>
              <td>${parseFloat(crypto.marketCapUsd).toFixed(2)}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default CoinTable;
